import './EspacoJogos.css'
import Jogo from '../Botao'


const EspacoJogos = () => {

    return (
        <section>
            {Jogos.map(jogo => 
            <Jogo 
            key={jogo.titulo} 
            titulo={jogo.titulo} 
            texto1={jogo.texto1} 
            texto2={jogo.texto2} 
            imagem1={jogo.imagem1} 
            imagem2={jogo.imagem2}
            />)}
        </section>
    )
}

export default EspacoJogos
